import styled from 'styled-components';

export const LoginWrapper = styled.div`
	position:absolute;
	top:0;
	left:0;
	bottom:0;
	right:0;
	background-color:#f1f1f1;
	.backHome{
		margin-top:56px;
		margin-left:50px;
		width:100px;
		display: block;
		.logoImg{
			width:100%;
		}
	}
`;

export const LoginArea = styled.div`
	width:400px;
	margin: 60px auto 0;
	padding: 50px 50px 30px;
	background-color: #fff;
  border-radius: 4px;
  box-shadow: 0 0 8px rgba(0,0,0,.1);
  vertical-align: middle;
  input{
  	display: block;
  	border:1px solid #c8c8c8;
  	width: 100%;
  	
  }
`;

export const HeaderText = styled.p`
	text-align:center;
	span{
		color:#969696;
		font-size: 18px;
		font-weight: 700;
		padding: 10px;
	}
	.loginText{
		color:#ea6f5a;
	}
`;
